import React from 'react'

const CurrencyRow = (props) => {
    const {
        currencyOptions
    }=props
    return (
        <>
            <input type='number' />

            <select>
                {currencyOptions.map(option=>{
                <option>{}op</option>

                })}
            </select>
        </>
    )
}

export default CurrencyRow
